import React from 'react';

class PropsUsageComponent extends React.Component{
      

    render(){
        const element = (
            <div>
              <h1>Hello, world!</h1>
              <h2>It is {new Date().toLocaleTimeString()}.</h2>
            </div>
          );
        return <h1 >this is props component learning!{element}</h1>;
    }

}
export default PropsUsageComponent;
